import React from 'react';

import BulletDescription from './BulletDescription';

class ExperienceIndi extends React.Component {
  state = {};

  render() {
    return (
      <div className="left-right">
        <div className="left-container">
          <div className="dates">
            <h2>{props.year}&nbsp;&nbsp;</h2>
            <h4>{props.months}</h4>
          </div>
        </div>

        <div
          className={
            { expanded } ? 'right-container-expanded' : 'right-container'
          }
          onClick={() => setExpanded(expanded => !expanded)}
        >
          <div className="right">
            <img
              className="logo"
              src={props.logo}
              alt={props.company + 'logo'}
              width="150px"
              height="150px"
            />
            <div className="content">
              <h2 className="title">{props.role}</h2>
              <h3 className="company"> &nbsp;@ {props.company}</h3>
              <BulletDescription descriptions={props.descriptions} />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ExperienceIndi;
